// fibo series

function fiboSeries(num) {
  let n1 = 0;
  let n2 = 1;
  let nextTerm = 0;

  for (let i = 0; i <= num; i++) {
    nextTerm = n1 + n2;
    n1 = n2;
    n2 = nextTerm;
  }

  console.log(nextTerm);
}

//fiboSeries(10);

//reverse num

function reverseNo(num) {
  let reve = 0;
  let temp = 0;

  while (num) {
    temp = num % 10;
    reve = reve * 10 + temp;
    num = Math.floor(num / 10);
  }

  //console.log(reve);
}

//reverseNo(10987654321);

// missing number in array

function findMiss(arrNum) {
  let n = arrNum.length;
  let total = ((n + 1) * (n + 2)) / 2;
  for (let i = 0; i < n; i++) {
    total = total - arrNum[i];
  }

  console.log('miss number', total);
}

// findMiss();

function setTimFun(num) {
  for (var i = 0; i <= num; i++) {
    (function (i) {
      setTimeout(() => {
        console.log(i);
      }, i * 1000);
    })(i);
  }
}

